When you are named after @SimoneBiles, you know you are meant to do incredible things.♥️ This #MentalHealthAwarenessMonth we’ve joined #NuloPartner Simone Biles to shine a spotlight on the incredible work that Simone The Therapy Dog and her mom, Dr. Sally, are doing at University Middle School at @uofmemphis.

@simone_the_therapydog was rescued as a puppy with her littermates, all showing severe signs of neglect. Now, Simone serves as a therapy dog at University Middle School, serving around 270 students in grades 6-8, bringing her calming presence and countless smiles to students and faculty every day. Simone’s important work is the perfect example of how our pets fuel the incredible in us.

Thank you, Simone and Sally, for the incredible work you do for your community! #TheyFuelUs #NuloPetFood

